import React from 'react';
import './App.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Dashboard from './pages/Dashboard';
import Header from './Components/Header';

function App() {
  return (
    <div className="App">
      <Header></Header>

      <Router>
        <Routes>
          <Route path='/' element={<Dashboard />}/>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
